package com.identity.ems.domain;import java.math.BigInteger;/** * Created by iroot on 2017. 4. 16.. */public class PerformanceInformation {    BigInteger buildingIdx;    BigInteger facilityIdx;    String facilityName;    BigInteger performanceIdx;    String performanceName;    String classType;    String formula;    public BigInteger getBuildingIdx() {        return buildingIdx;    }    public void setBuildingIdx(BigInteger buildingIdx) {        this.buildingIdx = buildingIdx;    }    public BigInteger getFacilityIdx() {        return facilityIdx;    }    public void setFacilityIdx(BigInteger facilityIdx) {        this.facilityIdx = facilityIdx;    }    public String getFacilityName() {        return facilityName;    }    public void setFacilityName(String facilityName) {        this.facilityName = facilityName;    }    public BigInteger getPerformanceIdx() {        return performanceIdx;    }    public void setPerformanceIdx(BigInteger performanceIdx) {        this.performanceIdx = performanceIdx;    }    public String getPerformanceName() {        return performanceName;    }    public void setPerformanceName(String performanceName) {        this.performanceName = performanceName;    }    public String getClassType() {        return classType;    }    public void setClassType(String classType) {        this.classType = classType;    }    public String getFormula() {        return formula;    }    public void setFormula(String formula) {        this.formula = formula;    }    @Override    public String toString() {        return "PerformanceInformation{" +                "buildingIdx=" + buildingIdx +                ", facilityIdx=" + facilityIdx +                ", facilityName='" + facilityName + '\'' +                ", performanceIdx=" + performanceIdx +                ", performanceName='" + performanceName + '\'' +                ", classType='" + classType + '\'' +                ", formula='" + formula + '\'' +                '}';    }}